import React, { Component } from 'react';
// import logo from './logo.svg';
import './App.css';
import Particles from 'react-particles-js';

const particlesOptions={
  particles:{
    number:{
      values:100,
      density:{
        enable:true,
        value_area:800
      }
    }
  }
}

class App extends Component{
  constructor(){
    super();
  }
  render(){
    return(
      <div className='App'>
          <Particles className='particles'
          params={particlesOptions}
          />
      </div>
    )
  } 
}

export default App;
